import React from 'react';
import './index.css';

export class StatsViewer extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            compName: "Stats",
            listTab1: []
        }
    }

    fetchTable() {
        var context = this;
        var filter = { "startingDate": this.stDate };
        var r = this.db.sendRequest("GraphController", "getPriorityIndexGraph", filter);
        r.then(function (response) {
          for (var json of response.data) {
            context.state.listTab1.push(json);
          }
        })
          .catch(function (error) {
            console.log(error);
          });
      }

    render() {
        if (this.state.listTab1){
            return this.state.listTab1.map((val) => function(){
                return <div>{val.index}</div>
            });
        }

        return <div>Stats</div>
    }
}

export default StatsViewer;
